function ItemListContainer() {
    return (
      <>
        <p 
        style={{
          color: 'black',
          fontSize: '50px',
          textAlign: 'center',
          }}>
          Bienvenido a STADIUM</p>
      </>
    );
  }
  
  export default ItemListContainer;
